BEGIN TRANSACTION;
CREATE TABLE allocations (
	id INTEGER NOT NULL, 
	normalized_item_name VARCHAR NOT NULL, 
	owner VARCHAR NOT NULL, 
	allocated_quantity INTEGER NOT NULL, 
	unit_cost NUMERIC(10, 2) NOT NULL, 
	excel_item_name VARCHAR NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE product_images (
	id INTEGER NOT NULL, 
	normalized_item_name VARCHAR NOT NULL, 
	image_url VARCHAR, 
	thumbnail_url VARCHAR, 
	description VARCHAR, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	updated_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, unit_cost REAL DEFAULT 0.00, 
	PRIMARY KEY (id)
);
CREATE TABLE transactions (
	id INTEGER NOT NULL, 
	order_id VARCHAR NOT NULL, 
	listing_title VARCHAR NOT NULL, 
	listing_description VARCHAR, 
	product_category VARCHAR, 
	buy_format VARCHAR, 
	sale_type VARCHAR, 
	quantity_sold INTEGER NOT NULL, 
	transaction_amount NUMERIC(10, 2) NOT NULL, 
	buyer_paid NUMERIC(10, 2) NOT NULL, 
	original_item_price NUMERIC(10, 2) NOT NULL, 
	transaction_type VARCHAR NOT NULL, 
	buyer_name VARCHAR, 
	buyer_state VARCHAR, 
	buyer_country VARCHAR, 
	order_placed_at DATETIME, 
	transaction_completed_at DATETIME, 
	source_file VARCHAR NOT NULL, 
	is_sale BOOLEAN NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	PRIMARY KEY (id)
);
